    import './Model.css';
    import Car from './model/car/Car';

    function Model() {

        return (
            <article className="model-content">
              
                <h3><span className="brand">FORD</span>&nbsp;<span className="model">MUSTANG</span></h3>
                <a className="image-link">
                  <img className="image" src="http://www.regcheck.org.uk/image.aspx/@Zm9yZCBtdXN0YW5n" />
                </a>
              
                <Car />
              
              </article>
        );
    }

    export default Model;
